extendedTextMessage.text:
 sebuah fungsi yang berfungsi untuk mengubah sebuah string menjadi sebuah tag html. Fungsi ini akan mengubah semua karakter spesial menjadi entity html.

Contoh:

```php
$string = '<div>';
$string = htmlspecialchars($string);
echo $string; // <div>
```

#### htmlspecialchars_decode

```php
htmlspecialchars_decode($string);
```

htmlspecialchars_decode() merupakan sebuah fungsi yang berfungsi untuk mengubah entity html menjadi karakter spesial.

Contoh:

```php
$string = '&lt;div&gt;';
$string = htmlspecialchars_decode($string);
echo $string; // <div>
```

#### htmlentities

```php
htmlentities($string);
```

htmlentities() merupakan sebuah fungsi yang berfungsi untuk mengubah sebuah string menjadi sebuah tag html. Fungsi ini akan mengubah semua karakter spesial menjadi entity html.

Contoh:

```php
$string = '<div>';
$string = htmlentities($string);
echo $string; // &lt;div&gt;
```

#### html_entity_decode

```php
html_entity_decode($string);
```

html_entity_decode() merupakan sebuah fungsi yang berfungsi untuk mengubah entity html menjadi karakter spesial.

Contoh:

```php
$string = '&lt;div&gt;';
$string = html_entity_decode($string);
echo $string; // <div>
```

#### strip_tags

```php
strip_tags($string);
```

strip_tags() merupakan sebuah fungsi yang berfungsi untuk menghapus tag html dari sebuah string.

Contoh:

```php
$string = '<div>Hello World</div>';
$string = strip_tags($string);
echo $string; // Hello World
```

#### trim

```php
trim($string);
```

trim() merupakan sebuah fungsi yang berfungsi untuk menghapus spasi dari sebuah string.

Contoh:

```php
$string = '   Hello World   ';
$string = trim($string);
echo $string; // Hello World
```

#### ltrim

```php
ltrim($string);
```

ltrim() merupakan sebuah fungsi yang berfungsi untuk menghapus spasi dari sebelah kiri sebuah string.

Contoh:

```php
$string = '   Hello World   ';
$string = ltrim($string);
echo $string; // Hello World  
```

#### rtrim

```php
rtrim($string);
```

rtrim() merupakan sebuah fungsi yang berfungsi untuk menghapus spasi dari sebelah kanan sebuah string.

Contoh:

```php
$string = '   Hello World   ';
$string = rtrim($string);
echo $string; //    Hello World
```

#### str_replace

```php
str_replace($needle, $replace, $haystack);
```

str_replace() merupakan sebuah fungsi yang berfungsi untuk mengganti sebuah string dengan sebuah string lainnya.

Contoh:

```php
$string = 'Hello World';
$string = str_replace('Hello', 'Hi', $string);
echo $string; // Hi World
```

#### str_ireplace

```php
str_ireplace($needle, $replace, $haystack);
```

str_ireplace() merupakan sebuah fungsi yang berfungsi untuk mengganti sebuah string dengan sebuah string lainnya. Fungsi ini tidak memperhatikan kapitalisasi.

Contoh:

```php
$string = 'Hello World';
$string = str_ireplace('hello', 'hi', $string);
echo $string; // hi World
```

#### str_repeat

```php
str_repeat($string, $count);
```

str_repeat() merupakan sebuah fungsi yang berfungsi untuk mengulang sebuah string sebanyak yang ditentukan.

Contoh:

```php
$string = 'Hello World';
$string = str_repeat($string, 3);
echo $string; // Hello WorldHello WorldHello World
```

#### str_shuffle

```php
str_shuffle($string);
```

str_shuffle() merupakan sebuah fungsi yang berfungsi untuk mengacak sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = str_shuffle($string);
echo $string; // dWorlHloelHlo
```

#### strlen

```php
strlen($string);
```

strlen() merupakan sebuah fungsi yang berfungsi untuk menghitung jumlah karakter sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = strlen($string);
echo $string; // 11
```

#### strpos

```php
strpos($haystack, $needle);
```

strpos() merupakan sebuah fungsi yang berfungsi untuk menemukan sebuah string dalam sebuah string lainnya.

Contoh:

```php
$string = 'Hello World';
$string = strpos($string, 'World');
echo $string; // 6
```

#### strrpos

```php
strrpos($haystack, $needle);
```

strrpos() merupakan sebuah fungsi yang berfungsi untuk menemukan sebuah string dalam sebuah string lainnya. Fungsi ini akan menemukan posisi terakhir dari sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = strrpos($string, 'l');
echo $string; // 9
```

#### strrev

```php
strrev($string);
```

strrev() merupakan sebuah fungsi yang berfungsi untuk membalik sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = strrev($string);
echo $string; // dlroW olleH
```

#### strtolower

```php
strtolower($string);
```

strtolower() merupakan sebuah fungsi yang berfungsi untuk mengubah sebuah string menjadi lowercase.

Contoh:

```php
$string = 'Hello World';
$string = strtolower($string);
echo $string; // hello world
```

#### strtoupper

```php
strtoupper($string);
```

strtoupper() merupakan sebuah fungsi yang berfungsi untuk mengubah sebuah string menjadi uppercase.

Contoh:

```php
$string = 'Hello World';
$string = strtoupper($string);
echo $string; // HELLO WORLD
```

#### ucfirst

```php
ucfirst($string);
```

ucfirst() merupakan sebuah fungsi yang berfungsi untuk mengubah huruf pertama sebuah string menjadi uppercase.

Contoh:

```php
$string = 'hello world';
$string = ucfirst($string);
echo $string; // Hello world
```

#### ucwords

```php
ucwords($string);
```

ucwords() merupakan sebuah fungsi yang berfungsi untuk mengubah huruf pertama dari setiap kata dalam sebuah string menjadi uppercase.

Contoh:

```php
$string = 'hello world';
$string = ucwords($string);
echo $string; // Hello World
```

#### substr

```php
substr($string, $start, $length);
```

substr() merupakan sebuah fungsi yang berfungsi untuk mengambil sebuah substring dari sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = substr($string, 6);
echo $string; // World
```

#### strstr

```php
strstr($haystack, $needle);
```

strstr() merupakan sebuah fungsi yang berfungsi untuk menemukan sebuah string dalam sebuah string lainnya.

Contoh:

```php
$string = 'Hello World';
$string = strstr($string, 'World');
echo $string; // World
```

#### stristr

```php
stristr($haystack, $needle);
```

stristr() merupakan sebuah fungsi yang berfungsi untuk menemukan sebuah string dalam sebuah string lainnya. Fungsi ini tidak memperhatikan kapitalisasi.

Contoh:

```php
$string = 'Hello World';
$string = stristr($string, 'world');
echo $string; // world
```

#### str_split

```php
str_split($string);
```

str_split() merupakan sebuah fungsi yang berfungsi untuk memecah sebuah string menjadi sebuah array.

Contoh:

```php
$string = 'Hello World';
$string = str_split($string);
print_r($string);

// Array
// (
//     [0] => H
//     [1] => e
//     [2] => l
//     [3] => l
//     [4] => o
//     [5] =>
//     [6] => W
//     [7] => o
//     [8] => r
//     [9] => l
//     [10] => d
// )
```

#### str_word_count

```php
str_word_count($string);
```

str_word_count() merupakan sebuah fungsi yang berfungsi untuk menghitung jumlah kata dalam sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = str_word_count($string);
echo $string; // 2
```

#### strrev

```php
strrev($string);
```

strrev() merupakan sebuah fungsi yang berfungsi untuk membalik sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = strrev($string);
echo $string; // dlroW olleH
```

#### str_rot13

```php
str_rot13($string);
```

str_rot13() merupakan sebuah fungsi yang berfungsi untuk mengacak sebuah string.

Contoh:

```php
$string = 'Hello World';
$string = str_rot13($string);
echo $string; // Uryyb Jbeyq
``
